interface IERC165 {
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}
abstract contract ERC165 is IERC165 {
    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
        return interfaceId == type(IERC165).interfaceId;
    }
}

interface IERC721 is IERC165 {
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    function balanceOf(address owner) external view returns (uint256 balance);
    function ownerOf(uint256 tokenId) external view returns (address owner);
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes calldata data
    ) external;

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;

    function approve(address to, uint256 tokenId) external;
    function setApprovalForAll(address operator, bool _approved) external;
    function getApproved(uint256 tokenId) external view returns (address operator);
    function isApprovedForAll(address owner, address operator) external view returns (bool);
}

interface IERC721Metadata is IERC721 {
    function name() external view returns (string memory);
    function symbol() external view returns (string memory);
    function tokenURI(uint256 tokenId) external view returns (string memory);
}

interface IERC721Receiver {
    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external returns (bytes4);
}

contract Ownable{
    address payable private _owner; 
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner); 
    constructor () {
        _owner = payable(msg.sender);
        emit OwnershipTransferred(address(0), _owner);
    } 
    function owner() public view returns (address payable) {
        return _owner;
    }
    modifier onlyOwner() {
        require(isOwner(), "Ownable: caller is not the owner");
        _;
    }
    function isOwner() public view returns (bool) {
        return msg.sender == _owner;
    }
    function renounceOwnership() public onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = payable(address(0));
    }
    function transferOwnership(address payable newOwner) public onlyOwner {
        _transferOwnership(newOwner);
    }
    function _transferOwnership(address payable newOwner) internal {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

contract ERC721 is Context, ERC165, IERC721, IERC721Metadata, Ownable  {
    using Address for address;
    using Strings for uint256;

    string private _name;

    string private _symbol;

    mapping(uint256 => address) private _owners;

    mapping(address => uint256) private _balances;

    mapping(uint256 => address) private _tokenApprovals;

    mapping(address => mapping(address => bool)) private _operatorApprovals;

    constructor(){

    }

    string private _baseURI;

    function setBaseURI(string memory baseURI_) public onlyOwner{
        _baseURI = baseURI_;
    }

    function setName(string memory name_) public onlyOwner{
        _name = name_;
    }
    function setSymbol(string memory symbol_) public onlyOwner{
        _symbol = symbol_;
    } 

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC721).interfaceId ||
            interfaceId == type(IERC721Metadata).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function balanceOf(address owner) public view virtual override returns (uint256) {
        require(owner != address(0), "ERC721: address zero is not a valid owner");
        return _balances[owner];
    }

    function ownerOf(uint256 tokenId) public view virtual override returns (address) {
        address owner = _ownerOf(tokenId);
        require(owner != address(0), "ERC721: invalid token ID");
        return owner;
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        _requireMinted(tokenId);

        string memory baseURI_ = baseURI(); 
        return bytes(baseURI_).length > 0 ? baseURI_ : "";
    }

    function baseURI() internal view virtual returns (string memory) {
        return _baseURI;
    }
 
    function approve(address to, uint256 tokenId) public virtual override {
        address owner = ERC721.ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(
            _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not token owner or approved for all"
        );

        _approve(to, tokenId);
    }
 
    function getApproved(uint256 tokenId) public view virtual override returns (address) {
        _requireMinted(tokenId);

        return _tokenApprovals[tokenId];
    }
 
    function setApprovalForAll(address operator, bool approved) public virtual override {
        _setApprovalForAll(_msgSender(), operator, approved);
    }
 
    function isApprovedForAll(address owner, address operator) public view virtual override returns (bool) {
        return _operatorApprovals[owner][operator];
    }
 
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        //solhint-disable-next-line max-line-length
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: caller is not token owner or approved");

        _transfer(from, to, tokenId);
    }
 
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }
 
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: caller is not token owner or approved");
        _safeTransfer(from, to, tokenId, data);
    }
 
    function _safeTransfer(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal virtual {
        _transfer(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, data), "ERC721: transfer to non ERC721Receiver implementer");
    }
 
    function _ownerOf(uint256 tokenId) internal view virtual returns (address) {
        return _owners[tokenId];
    }
 
    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }
 
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns (bool) {
        address owner = ERC721.ownerOf(tokenId);
        return (spender == owner || isApprovedForAll(owner, spender) || getApproved(tokenId) == spender);
    } 

    function _safeMint(address to, uint256 tokenId) internal virtual {
        _safeMint(to, tokenId, "");
    }
 
    function _safeMint(
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal virtual {
        _mint(to, tokenId);
        require(
            _checkOnERC721Received(address(0), to, tokenId, data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }
 
    function _mint(address to, uint256 tokenId) internal virtual {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);

        // Check that tokenId was not minted by `_beforeTokenTransfer` hook
        require(!_exists(tokenId), "ERC721: token already minted");

        unchecked {
            // Will not overflow unless all 2**256 token ids are minted to the same owner.
            // Given that tokens are minted one by one, it is impossible in practice that
            // this ever happens. Might change if we allow batch minting.
            // The ERC fails to describe this case.
            _balances[to] += 1;
        }

        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);

        _afterTokenTransfer(address(0), to, tokenId);
    }
 
    function _burn(uint256 tokenId) internal virtual {
        address owner = ERC721.ownerOf(tokenId);

        _beforeTokenTransfer(owner, address(0), tokenId);

        // Update ownership in case tokenId was transferred by `_beforeTokenTransfer` hook
        owner = ERC721.ownerOf(tokenId);

        // Clear approvals
        delete _tokenApprovals[tokenId];

        unchecked {
            // Cannot overflow, as that would require more tokens to be burned/transferred
            // out than the owner initially received through minting and transferring in.
            _balances[owner] -= 1;
        }
        delete _owners[tokenId];

        emit Transfer(owner, address(0), tokenId);

        _afterTokenTransfer(owner, address(0), tokenId);
    } 

    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(ERC721.ownerOf(tokenId) == from, "ERC721: transfer from incorrect owner");
        require(to != address(0), "ERC721: transfer to the zero address");

        _beforeTokenTransfer(from, to, tokenId);

        // Check that tokenId was not transferred by `_beforeTokenTransfer` hook
        require(ERC721.ownerOf(tokenId) == from, "ERC721: transfer from incorrect owner");

        // Clear approvals from the previous owner
        delete _tokenApprovals[tokenId];

        unchecked { 
            _balances[from] -= 1;
            _balances[to] += 1;
        }
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);

        _afterTokenTransfer(from, to, tokenId);
    }
 
    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[tokenId] = to;
        emit Approval(ERC721.ownerOf(tokenId), to, tokenId);
    }
 
    function _setApprovalForAll(
        address owner,
        address operator,
        bool approved
    ) internal virtual {
        require(owner != operator, "ERC721: approve to caller");
        _operatorApprovals[owner][operator] = approved;
        emit ApprovalForAll(owner, operator, approved);
    }
 
    function _requireMinted(uint256 tokenId) internal view virtual {
        require(_exists(tokenId), "ERC721: invalid token ID");
    } 

    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) private returns (bool) {
        if (to.isContract()) {
            try IERC721Receiver(to).onERC721Received(_msgSender(), from, tokenId, data) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    /// @solidity memory-safe-assembly
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }
 
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {}
 
    function _afterTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {}
 
    function _beforeConsecutiveTokenTransfer(
        address from,
        address to,
        uint256, /*first*/
        uint96 size
    ) internal virtual {
        if (from != address(0)) {
            _balances[from] -= size;
        }
        if (to != address(0)) {
            _balances[to] += size;
        }
    }
 
    function _afterConsecutiveTokenTransfer(
        address, /*from*/
        address, /*to*/
        uint256, /*first*/
        uint96 /*size*/
    ) internal virtual {}
}

contract Metafloris is ERC721 {

    using SafeMath for uint256;
    using Strings for uint256;

    // can not buy between antibotInterval  for bot attack
    mapping(address => uint256) private _lastCallBlockNumber;
    uint256 private _antibotInterval;

    uint256 private _mintMaxCnt;
    uint256 private _mintNowIndex; 
    uint256 private _priceUnit;
        
    struct MetaflorisFlower {
        uint256 _flowerType; 
        string _flowerName;
        uint256 _maxAmount;
        string  _tokenInfoUri;
        uint256 _price; 
    }  


    //tokenId - Flowertype  mapping
    mapping(uint256 => uint256) private _tokenIdAndFlowerTypeMap;
    //Flowertype - MetaflorisFlowerInfo mapping
    mapping(uint256 => MetaflorisFlower) private _productsMap;
    //Flowertype - sellCnt mapping
    mapping(uint256 => uint256) private _productSellStateMap;
    uint256 private _flowerTypeCnt=0;

    function getProductSellState(uint256 flowerType) public onlyOwner view returns (uint256){
        return _productSellStateMap[flowerType];
    }

    function getFlowerItemByTokenId(uint256 tokenId) public onlyOwner view returns (MetaflorisFlower memory){
        return  _productsMap[_tokenIdAndFlowerTypeMap[tokenId]];
    }

    function getFlowerTypeCnt() public onlyOwner view returns (uint256){
        return _flowerTypeCnt;
    }

    function getMetaflorisFlowerInfo(uint256 flowerType) public onlyOwner view returns (MetaflorisFlower memory){
        return _productsMap[flowerType];
    }
    
    function getFlowerInfo(uint256 flowerType) private view returns (MetaflorisFlower memory){ 
        return _productsMap[flowerType];
    } 

    function addProduct(string memory flowerName, uint256 maxAmount, string memory tokenUri, uint256 price) public onlyOwner returns (MetaflorisFlower memory)  {
        uint256 tempId = _flowerTypeCnt;
        _flowerTypeCnt+=1;
        _productsMap[tempId] =  MetaflorisFlower(tempId, flowerName, maxAmount, tokenUri, price*_priceUnit); 
        _productSellStateMap[tempId] = 0; 
        return _productsMap[tempId];
    }

    function chaneProductInfo(uint flowerType,  string memory flowerName, uint256 maxAmount, string memory tokenUri, uint256 price) public onlyOwner {
        _productsMap[flowerType] = MetaflorisFlower(flowerType, flowerName, maxAmount, tokenUri, price*_priceUnit);
    }
        

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        override(ERC721)
    {
        holdTimeMap[tokenId] = block.timestamp; 
        super._beforeTokenTransfer(from, to, tokenId);
    }
    
    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721)
        returns (string memory)
    {  
        string memory path = super.tokenURI(tokenId);
        
        MetaflorisFlower memory flower = _productsMap[_tokenIdAndFlowerTypeMap[tokenId]]; 

        string memory result = string(abi.encodePacked(string(abi.encodePacked(string(abi.encodePacked(path, flower._tokenInfoUri)), tokenId.toString() )), ".json"));
 
        return bytes(result).length > 0 ? result : "";
    }


    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
  
    function getLastCallBlockNumber() public view returns (uint256){
        return _lastCallBlockNumber[msg.sender];
    }

    constructor(){
        _mintNowIndex=0; 
        _antibotInterval = 3;
        _priceUnit = 1e15; //1 ether=>  1e18 ,  
    }  
 
    //public mintting
    function buyNFT(uint256 flowerType) external payable{
        require(flowerType < _flowerTypeCnt , "It is not exist flower Type");  

        MetaflorisFlower memory flowerInfo = getFlowerInfo(flowerType); 
        require(msg.value >= flowerInfo._price, "Not enough eth"); 
        require(_productSellStateMap[flowerType].add(1) <= _productsMap[flowerType]._maxAmount, "Exceed max amount"); 
     //   require(_lastCallBlockNumber[msg.sender].add(_antibotInterval) < block.number, "Bot is not allowed");  

        uint256 tokenId = _mintNowIndex;
        _mintNowIndex = _mintNowIndex.add(1); 
        _safeMint(msg.sender, tokenId);  

        _tokenIdAndFlowerTypeMap[tokenId] = flowerType;
        _productSellStateMap[flowerType] = _productSellStateMap[flowerType].add(1); 
        _lastCallBlockNumber[msg.sender] = block.number;
        changeHoldTime(tokenId);
    }

    
    //for calculating the NFT hold time.
    //tokenId - date mapping
    mapping(uint256 => uint256) holdTimeMap;

    function changeHoldTime(uint256 tokenId) public{
        require(_ownerOf(tokenId) == msg.sender, "Only the owner can change");
        
        holdTimeMap[tokenId] = block.timestamp;   
    }
    function getHoldTimeMap(uint256 tokenId) public view returns (uint256){
        return holdTimeMap[tokenId]; 
    } 
}

